import React, { Component } from "react";
import {Card} from 'react-bootstrap';

export default class Footer extends Component {
  render() {
    return (
      <>
        <Card className="text-center ">
          <Card.Footer className="text-muted">Amanda Barboza</Card.Footer>
        </Card>
      </>
    );
  }
}
